import React from 'react'

const Outbutton = () =>{
    const butstyle = {
        justifyContent:'center',
        alignItem:'center',
        padding:'1em'

    };
    return(

        <div style={butstyle}>
            <button>Shorten</button>
        </div>
    );
}

export default Outbutton;
